import React from 'react';

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <a href="/" className="brand"><h1>Home</h1></a>

            <div className="links">
                <a href="/about">About</a>
                <a href="/menu">Menu</a>

                <a href="/tbd">Order Online</a>
                <a href="/contact">Contact</a>
            </div>
        </nav>
    );
}

export default Navbar;
